Leve uma panela média com água ao fogo alto. Assim que ferver adicione 1 colher (chá) de sal e 1 colher (chá) de vinagre, junte os floretes e deixe cozinhar por apenas 2 minutos. Com uma escumadeira, transfira os floretes para a tigela com água e gelo. 
Deixe escorrer bem!

No processador de alimentos, coloque os floretes em etapas e bata até ficar com textura de arroz.

Leve uma frigideira grande ao fogo médio. Quando aquecer, regue com o azeite, junte cebola picadinha e a couve-flor processada. Refogue por cerca de 2 minutos. Diminua o fogo, misture as alcaparras (sem o líquido) e deixe cozinhar por mais 5 minutos - o arroz deve ficar macio e úmido. Tempere com sal e pimenta-do-reino moída na hora a gosto.
