Big thanks to @proteinmilkshake for letting me try their Chocolate Sundae Protein Powder! I turned it into a mini cake loaf with a sweet glaze on top. I really enjoy the simple ingredients of this powder and that it tastes so good by itself or in baked goods! No grittiness or weird aftertaste. And 22 grams of protein!

Loaf recipe:
* 1 package of @proteinmilkshake Chocolate Sundae powder
* 1 1/4 cup of almond flour
* 1 tsp. Baking Powder
* 1 large egg
* 3 tbsp. Coconut Oil (melted)
* 1/4 cup unsweetened almond milk
** mix together and put into small  loaf pan. Bake @ 325 ℉ for 25 mins. Enjoy with your favorite topping!
