I tend to be a very impatient person. I want things to manifest now. However, over time I’ve learned to be grateful to it. I have learned to cherish time. Why? Because it takes time to get to your goals. It takes time to lose weight. It takes time to develop a healthy mindset. It just does. So without time, we wouldn’t be able to achieve these things.
•
It took 6 years of actively fighting my bulimia to be where I am now and the first 4 were terrible. It took TIME. Without time being there, I wouldn’t have been able to achieve what I have. NEITHER. WOULD. YOU.
•
So instead of being impatient and wanting it now, be grateful for time. At least it give you an actually opportunity to succeed. Without it, you wouldn’t stand a chance.🔥
•
