INGREDIENTES EL TRES LECHES

1/2 taza de harina de coco
1/2 cucharadita de levadura en polvo
1 taza de edulcorante para hornear Lakanto Monkfruit
1 cucharadita de sal
6 huevos
1/2 taza de mantequilla derretida y enfriada
1 cucharadita de extracto de vainilla
1 cucharadita de extracto líquido de Monkfruit Lakanto Extracto de  Vanilla
También necesitará tres leches diferentes para esta receta, ¡de ahí el nombre Tres Leches Cake!

1/2 taza de leche de coco sin azúcar
1/2 taza mitad y mitad
1/2 taza de crema espesa

INSTRUCCIONES PARA PASTEL TRES LECHES

Precaliente su horno a 350 grados.
Cubra el fondo de un molde para pasteles de 9 pulgadas con papel pergamino, luego cubra con aceite de coco o aguacate en aerosol para hornear.
Batir la harina de coco, el polvo de hornear y 1/2 taza de edulcorante para hornear Lakanto Monkfruit en un tazón. Dejar de lado.
Coloque las claras de huevo en una batidora de pie con el endulzante para hornear Lakanto Monkfruit restante y mezcle hasta que se formen picos rígidos.
En otro bol batir las yemas de huevo, la mantequilla, el extracto de vainilla y el extracto de vainilla líquido de Monkfruit.
Incorpora la mezcla de harina de coco a la mezcla de yema de huevo.
Incorpore suavemente las claras de huevo endurecidas en pequeños lotes en la masa de harina de coco. ¡Cuidado con no mezclar demasiado!
Vierta la masa en el molde para pasteles preparado y hornee durante 25-30 minutos. Dejar enfriar unos 20 minutos, no sacar de la sartén.
Después de enfriar, tome una brocheta o un cuchillo afilado y haga agujeros en todo el pastel.
En otro tazón, mezcle la leche de coco, mitad y mitad, crema espesa.
Vierta esto sobre el pastel en todos los agujeros. Deje reposar durante 30 minutos.";}i:173;a:1:{s:14:"comments_count";i:1;}i:174;a:1:{s:11:"likes_count";i:13;}i:175;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEu0ZzrhlU2";}i:176;a:1:{s:5:"image";s:239:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/118780552_1508827885955837_1557645244573518245_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=105&_nc_ohc=TMTrMW3YHhYAX9S7IL3&oh=e0b318e1094d7584bd07cd4f31bee751&oe=5F7E3C1B";}i:177;a:1:{s:4:"type";s:7:"sidecar";}i:178;a:1:{s:8:"owner_id";i:12167798791;}i:179;a:1:{s:14:"owner_username";s:0:"";}i:180;a:1:{s:14:"owner_fullname";s:0:"";}i:181;a:1:{s:9:"owner_pic";s:0:"";}i:182;a:1:{s:2:"id";s:19:"2391078319962883735";}i:183;a:1:{s:10:"short_code";s:11:"CEu0RBDhoaX";}i:184;a:1:{s:12:"created_time";i:1599258769;}i:185;a:1:{s:7:"caption";s:348:"Day 27 lunch/dinner, Paneer bhurji (scrambled and spiced paneer) with creamy cauliflower spinach soup! 

