and Paleo diets.⁠
SERVINGS: 3 / By @ketomeallove ⁠
.⁠
.⁠
1. INSTRUCTIONS⁠
01. Prepare the celery, onion, and cilantro,⁠
placing in a medium bowl. Dice the chicken⁠
and add it to the bowl with the vegetables.⁠
02. Cut into the avocado with a chef’s knife⁠
until the blade hits the pit. Slide the knife⁠
around the pit, cutting the avocado in half.⁠
Twist the halves to separate. Remove the⁠
pit by tapping the knife into the pit until⁠
it sticks, make sure the avocado half is⁠
held steadily on a cutting board before⁠
attempting. Scoop out the avocado flesh⁠
with a spoon and place into a small bowl.⁠
Mash with a fork until smooth and creamy.⁠
Stir in the lemon juice and oil.⁠
03. Add the mashed avocado to the to the⁠
chicken and vegetables and stir to mix. Serve⁠
over lettuce or enjoy on a low carb bagel.⁠
04. Makes 3, 3/4-1 cup servings.⁠
.⁠
.⁠
